import { DcxNgBreadcrumbComponent, } from '@dcx-ng-components/dcx-ng-lib';
const meta = {
    title: 'DCXLibrary/Breadcrumb/Unstyled',
    component: DcxNgBreadcrumbComponent,
    tags: ['autodocs'],
    argTypes: {
        items: { control: { type: 'object' } },
    },
    args: {
        items: [
            { label: 'Home', href: '/' },
            { label: 'Library', href: '/library' },
            { label: 'Data' },
        ],
    },
};
export default meta;
export const Basic = {
    render: args => ({
        props: { ...args },
        template: `<dcx-ng-breadcrumb [items]="items"></dcx-ng-breadcrumb>`,
    }),
};
